CREATE VIEW ods.view_locks AS
 SELECT pg_class.relname AS relation_name,
    pg_stat_activity.query,
    pg_locks.locktype,
    pg_locks.database,
    pg_locks.relation,
    pg_locks.page,
    pg_locks.tuple,
    pg_locks.virtualxid,
    pg_locks.transactionid,
    pg_locks.classid,
    pg_locks.objid,
    pg_locks.objsubid,
    pg_locks.virtualtransaction,
    pg_locks.pid,
    pg_locks.mode,
    pg_locks.granted,
    pg_locks.fastpath,
    pg_locks.waitstart
   FROM ((pg_locks
     JOIN pg_class ON ((pg_locks.relation = pg_class.oid)))
     JOIN pg_stat_activity ON ((pg_locks.pid = pg_stat_activity.pid)));

ALTER TABLE ods.view_locks OWNER TO proconnect;

CREATE VIEW ods.view_tableschema AS
 SELECT t.table_name,
    t.table_catalog,
    c.table_schema,
    c.column_name,
    c.is_nullable,
    c.data_type,
    c.character_maximum_length,
    c.is_identity,
    con.constraint_name
   FROM ((information_schema.tables t
     JOIN information_schema.columns c ON ((((t.table_name)::name = (c.table_name)::name) AND ((t.table_schema)::name = (c.table_schema)::name))))
     LEFT JOIN information_schema.constraint_column_usage con ON ((((c.table_name)::name = (con.table_name)::name) AND ((c.table_schema)::name = (con.table_schema)::name) AND ((c.column_name)::name = (con.column_name)::name))));

ALTER TABLE ods.view_tableschema OWNER TO proconnect;

COMMENT ON VIEW ods.view_tableschema IS 'to view the table schema';

